crearGrafico(
  "graficoInversa",
  () => graficoInversa.setCoordSystem(-6, 6, -6, 6),
  undefined,
  undefined,
  undefined,
  ""
);

const creaEstadoInvertida = () => {
  let invertida = false;
  return function () {
    invertida = !invertida;
    return !invertida;
  };
};
const yaEstaInvertida = creaEstadoInvertida();

const invertir = () => {
  yaEstaInvertida()
    ? document
        .querySelector("#graficoInversa")
        .classList.remove("graficoInvertido")
    : document
        .querySelector("#graficoInversa")
        .classList.add("graficoInvertido");
};
